import React from 'react';
import './Home.css';
import mateofabian from './mateofabian.jpeg';

function Home(){
    return(
        <div className="content">
            <div className="title">
                <h2>Mateo Jara Fabian</h2>
            </div>
            <div className="left-content">
                <image src="https://images.pexels.com/photos/20787/pexels-photo.jpg?auto=compress&cs=tinysrgb&h=350" alt="mateo" width="100" height="50"/>
                <p>Here picture!</p>
            </div>
            <div className="right-content">
                <p>Here description</p>
            </div>
        </div>
    )
}

export default Home;
